# Configure this correctly. Otherwise, the prober will not succeed in getting OTA URLs!
# All Android fingerprints follow the following format:
#   <oem>/<product>/<device>:<android_version>/<build_tag>/<incremental>:user/release-keys
#   Nothing/Asteroids/Asteroids:15/AQ3A.241015.001/2506101841:user/release-keys

build_tag: "AQ3A.241015.001"       # Example: RKQ1.211119.001
incremental: "2506101841"     # Example: 2206131341
android_version: "15" # Only put in the major version number.
oem: "Nothing"             # The company that made your device (e.g. Samsung)
device: "Asteroids"          # The device code. May be same as model code.
model: "A059"           # The model code. (e.g. SM-T380)
product: "Asteroids"         # The product code. May be same as device code or model code.
